local textures = {
    effect_vortex = "",
    effect_vortex_blue = "",
    effect_earth_primary = "",
    effect_earth_secondary = "",
    effect_void_primary = "",
    effect_void_secondary = "",
    effect_fire_primary = "",
    effect_ice_secondary = "",
    effect_water_primary = "",
    effect_water_secondary = "",
    effect_electric_primary = "",
    effect_wind_primary = "",
    effect_wind_primary_sneak = "",
    effect_resize_primary = "",
    effect_resize_secondary = "",
    effect_shadow_primary = "",
}
for k, v in pairs(textures) do
    textures[k] = "blank.png^[png:" .. textures[k]
    minetest.register_node(":magikacia:zzz_textures_" .. k, {
        description = k,
        groups = { dig_immediate = 3, not_in_creative_inventory = 1, },
        tiles = {
            "blank.png",
            "blank.png",
            "blank.png",
            "blank.png",
            "blank.png",
            {
                name = textures[k],
                animation = {
                    type = "vertical_frames",
                    aspect_w = 32,
                    aspect_h = 32,
                    length = 1.0,
                }
            },
            "blank.png",
        },
        use_texture_alpha = "clip",
        paramtype2 = "facedir",
        drawtype = "allfaces",
    })
    for i = 1, 4 do
        minetest.register_node(":magikacia:zzz_textures_" .. k .. "_" .. i, {
            description = k .. "_" .. i,
            groups = { dig_immediate = 3, not_in_creative_inventory = 1, },
            tiles = {
                "blank.png",
                "blank.png",
                "blank.png",
                "blank.png",
                textures[k] .. "^[verticalframe:4:" .. i,
                textures[k] .. "^[verticalframe:4:" .. i,
                "blank.png",
                "blank.png",
            },
            use_texture_alpha = "clip",
            paramtype = "light",
            paramtype2 = "facedir",
            sunlight_propagates = true,
            drawtype = "allfaces",
        })
    end
end
table.update(magikacia.textures, textures)